import React, { useEffect, useState } from "react";
import axios from "axios";
import { DataGrid } from "@mui/x-data-grid";

const Home = () => {
  const [bajones, setBajones] = useState([]);

  useEffect(() => {
    axios
      .get("/prueba")
      .then((res) => {
        const data = res.data;
        setBajones(data);
      })
      .catch((err) => console.log(err));
  }, []);


  return (
    <div>
    <table className="table">
    <thead>
      <tr>
        <th scope="col">#</th>
        <th scope="col">Nombre de empleado</th>
        <th scope="col">Sector</th>
        <th scope="col">Edad</th>
        <th scope="col">Email</th>
      </tr>
    </thead>
    <tbody>
    <div>
      <h1>
        {bajones.map((bajon) => (
          <div>
            <h1>{bajon.name}</h1>
            <h1>{bajon.age}</h1>
            <h1>{bajon.sector}</h1>
            <h1>{bajon.email}</h1>
          </div>
        ))}
      </h1>  
    </div>
      <tr>
        <th scope="row">1</th>
        <td>Mark</td>
        <td>Otto</td>
        <td>@mdo</td>
      </tr>
      <tr>
        <th scope="row">2</th>
        <td>Jacob</td>
        <td>Thornton</td>
        <td>@fat</td>
      </tr>
      <tr>
        <th scope="row">3</th>
        <td colspan="2">Larry the Bird</td>
        <td>@twitter</td>
      </tr>
    </tbody>
  </table>
  </div>
  );
};

export default Home;
